import React from "react";
import "../src/css/home.css";
import { useNavigate } from "react-router-dom";
import AdSense from "react-adsense";
function Home() {
  const navigate = useNavigate();
  const bp = () => {
    navigate("/bgmi");
  };
  const fp = () => {
    navigate("/ff");
  };
  return (
    <div className="hmain">
      <div id="hh">MOBILE GAMES</div>
      <div className="hbody">
        <button id="hb" onClick={bp}></button>
        <button id="hf" onClick={fp}></button>
      </div>
      <div style={{width:"100%"}}>
        <AdSense.Google
          client="ca-pub-7482778154397164"
          slot="3081667711"
          style={{ display: "block", with: "100%" }}
          format="auto"
          responsive="true"
        />
      </div>
    </div>
  );
}
export default Home;
